import Link from "next/link";

function Navbar() {
  return (
    <nav className="Nav">
      <Link href="/">
        <a>Westfield Web</a>
      </Link>
      <Link href="/plansandpricing">
        <a>Plans and Pricing</a>
      </Link>
      <Link href="/portfolio">
        <a>Portfolio</a>
      </Link>
    </nav>
  );
}

export default Navbar;
